window.bookSummaryJSON = "<p>Welcome to the world of Zaneen, a world with a dark past and more secrets than answers. For Lian, a 12-year-old orphan, the world consists only of his remote village and the hazardous mountains surrounding it. He always questioned his existence and longed for meaning; Lian will soon get his answers. </p> <p>After his birthday gets off to a rocky start, Zaneen's dark past erupts into the present with a violent fury. When that fury leaves Lian truly alone, with the exception of an unexpected companion, Lian must learn the secrets of his own past in order to save his world from a thousand-year-old conflict. </p>"; 
